"     DePadua FI, Pereirnha A, Lopes MG. Conduction defects. In: Comprehensive Electrocardiography: Theory and Practice in Health and Disease, MacFarlane P, Veitch Lawrie TD (Eds), Pergamon Press, New York 1989. p.459.",
