var title_f39_49_40725="Fracture of thumb metacarpal base Bennetts";
var content_f39_49_40725=[" <div id=\"graphicsToolbar\">",
"  <div id=\"graphicsCopy\">",
"   &copy;2013 UpToDate",
"   <sup>",
"    &reg;",
"   </sup>",
"  </div>",
"  <div id=\"graphicsLinks\">",
"   <a href=\"?imageKey=EM%2F72289%7EEM%2F50297%7EEM%2F63101&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=3\" onclick=\"\">",
"    <img alt=\"Print this page\" src=\"./../images/icn_print.myextg\" title=\"Print this page\"/>",
"   </a>",
"   <a class=\"icontxt textLink\" href=\"?imageKey=EM%2F72289%7EEM%2F50297%7EEM%2F63101&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=3\" onclick=\"\" title=\"Print this page\">",
"    Print",
"   </a>",
"   <a class=\"etacLink\" href=\"#\">",
"    <img alt=\"Email graphic(s)\" src=\"./../images/icn_email.myextg\" title=\"Email graphic(s)\"/>",
"   </a>",
"   <a class=\"icontxt textLink etacLink\" href=\"#\" title=\"Email graphic(s)\">",
"    Email",
"   </a>",
"  </div>",
" </div>",
" <div class=\"graphic\">",
"  <div class=\"figure\" style=\"width: 470px\">",
"   <div class=\"ttl\">",
"    Fracture of thumb metacarpal base: Type I (Bennett's)",
"   </div>",
"   <div class=\"cntnt\" style=\"width: 442px; height: 331px; background-image: url(data:image/jpeg;base64,);\">",
"   </div>",
"   <div class=\"lgnd\">",
"    Each of these anteroposterior radiographs shows an intra-articular fracture of the thumb metacarpal. The Type I or \"Bennett's\" fracture of the proximal 1st metacarpal illustrated here is characterized by its articular involvement and the persistent attachment of the volar fragment to the trapezium.",
"    <div class=\"footnotes\">",
"    </div>",
"    <div class=\"reference\">",
"     Courtesy of Kevin Burroughs, MD.",
"    </div>",
"   </div>",
"  </div>",
" </div>",
" <div class=\"graphic\">",
"  <div class=\"figure\" style=\"width: 470px\">",
"   <div class=\"ttl\">",
"    Extraarticular fracture of the first metacarpal",
"   </div>",
"   <div class=\"cntnt\" style=\"width: 264px; height: 360px; background-image: url(data:image/jpeg;base64,);\">",
"   </div>",
"   <div class=\"lgnd\">",
"    This anteroposterior radiograph shows a type III fracture of the proximal 1st metacarpal with characteristic sparing of the articular surface. Significant shortening of the metacarpal is also apparent in this view.",
"    <div class=\"footnotes\">",
"    </div>",
"    <div class=\"reference\">",
"     Courtesy of Kevin Burroughs, MD.",
"    </div>",
"   </div>",
"  </div>",
" </div>",
" <div class=\"graphic\">",
"  <div class=\"figure\" style=\"width: 470px\">",
"   <div class=\"ttl\">",
"    Nondisplaced thumb metacarpal fracture",
"   </div>",
"   <div class=\"cntnt\" style=\"width: 270px; height: 360px; background-image: url(data:image/jpeg;base64,);\">",
"   </div>",
"   <div class=\"lgnd\">",
"    In this radiograph a nondisplaced fracture of the&nbsp;thumb metacarpal distal to the carpal metacarpal joint is seen. This is a nondisplaced type III fracture of the first metacarpal.",
"    <div class=\"footnotes\">",
"    </div>",
"    <div class=\"reference\">",
"     Courtesy of Kevin Burroughs, MD.",
"    </div>",
"   </div>",
"  </div>",
" </div>",
"</div>"].join("\n");
