"      Clobamax (PE);",
"     </li>",
"     <li>",
"      Clobator (IN);",
"     </li>",
"     <li>",
"      Clobazam (PE);",
"     </li>",
"     <li>",
"      Clofritis (ID);",
"     </li>",
"     <li>",
"      Clopax (ES);",
"     </li>",
"     <li>",
"      Frisium (AT, AU, BE, BR, CR, CZ, DE, DK, DO, FI, GB, GR, GT, HK, HN, HU, IE, IL, IN, IT, LU, MY, NI, NL, NZ, PA, PK, PL, SG, SV, TH, TW, UY, VE);",
"     </li>",
