"   <div class=\"block pha drugH1Div\" id=\"F152557\" xmlns=\"file://www.w3.org/1999/xhtml\">",
"    <span class=\"drugH1\">",
"     Mechanism of Action",
"    </span>",
"    <p style=\"text-indent:0em;display:inline\">",
"     Clobazam is a 1,5 benzodiazepine which binds to stereospecific benzodiazepine receptors on the postsynaptic GABA neuron at several sites within the central nervous system, including the limbic system, reticular formation. Enhancement of the inhibitory effect of GABA on neuronal excitability results by increased neuronal membrane permeability to chloride ions. This shift in chloride ions results in hyperpolarization (a less excitable state) and stabilization.",
"    </p>",
"   </div>",
"   <div class=\"block phk drugH1Div\" id=\"F152572\" xmlns=\"file://www.w3.org/1999/xhtml\">",
"    <span class=\"drugH1\">",
"     Pharmacodynamics/Kinetics",
"    </span>",
"    <p style=\"text-indent:-2em;margin-left:2em;text-align:justify;\">",
"     Absorption: Rapid; ~87%",
"    </p>",
"    <p style=\"text-indent:-2em;margin-left:2em;text-align:justify;\">",
"     Protein binding: 80% to 90%",
"    </p>",
"    <p style=\"text-indent:-2em;margin-left:2em;text-align:justify;\">",
"     Metabolism: Hepatic via CYP3A4 and to a lesser extent via CYP2C19 and 2B6 (N-demethylation to active metabolite [N-desmethyl] with ~20% activity of clobazam). CYP2C19 primarily mediates subsequent hydroxylation of the N-desmethyl metabolite.",
"    </p>",
"    <p style=\"text-indent:-2em;margin-left:2em;text-align:justify;\">",
"     Half-life elimination: 36-42 hours; N-desmethyl (active): 71-82 hours",
"    </p>",
"    <p style=\"text-indent:-2em;margin-left:2em;text-align:justify;\">",
"     Time to peak: 30 minutes to 4 hours",
"    </p>",
"    <p style=\"text-indent:-2em;margin-left:2em;text-align:justify;\">",
"     Excretion: Urine (~94%), as metabolites",
"    </p>",
"   </div>",
