var title_f39_49_40730="Major histologic patterns of invasive adenocarcinoma";
var content_f39_49_40730=[" <div id=\"graphicsToolbar\">",
"  <div id=\"graphicsCopy\">",
"   &copy;2013 UpToDate",
"   <sup>",
"    &reg;",
"   </sup>",
"  </div>",
"  <div id=\"graphicsLinks\">",
"   <a href=\"?imageKey=ONC%2F80147&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=1\" onclick=\"\">",
"    <img alt=\"Print this page\" src=\"./../images/icn_print.myextg\" title=\"Print this page\"/>",
"   </a>",
"   <a class=\"icontxt textLink\" href=\"?imageKey=ONC%2F80147&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=1\" onclick=\"\" title=\"Print this page\">",
"    Print",
"   </a>",
"   <a class=\"etacLink\" href=\"#\">",
"    <img alt=\"Email graphic(s)\" src=\"./../images/icn_email.myextg\" title=\"Email graphic(s)\"/>",
"   </a>",
"   <a class=\"icontxt textLink etacLink\" href=\"#\" title=\"Email graphic(s)\">",
"    Email",
"   </a>",
"  </div>",
" </div>",
" <div class=\"graphic\">",
"  <div class=\"figure\" style=\"width: 470px\">",
"   <div class=\"ttl\">",
"    Major histologic patterns of invasive adenocarcinoma",
"   </div>",
"   <div class=\"cntnt\" style=\"width: 435px; height: 658px; background-image: url(data:image/jpeg;base64,);\">",
"   </div>",
"   <div class=\"lgnd\">",
"    (A) Lepidic predominant pattern with mostly lepidic growth (right) and a smaller area of invasive acinar adenocarcinoma (left).",
"    <br>",
"     (B) Lepidic pattern consists of a proliferation type II pneumocytes and Clara cells along the surface alveolar walls.",
"     <br>",
"      (C) Area of invasive acinar adenocarcinoma (same tumor as in A and B).",
"      <br>",
"       (D) Acinar adenocarcinoma consists of round to oval-shaped malignant glands invading a fibrous stroma.",
"       <br>",
"        (E) Papillary adenocarcinoma consists of malignant cuboidal to columnar tumor cells growing on the surface of fibrovascular cores.",
"        <br>",
"         (F) Micropapillary adenocarcinoma consists of small papillary clusters of glandular cells growing within this airspace, most of which do not show fibrovascular cores.",
"         <br>",
"          (G) Solid adenocarcinoma with mucin consisting of sheets of tumor cells with abundant cytoplasm and mostly vesicular nuclei with several conspicuous nucleoli. No acinar, papillary, or lepidic patterns are seen, but multiple cells have intracytoplasmic basophilic globules that suggest intracytoplasmic mucin.",
"          <br>",
"           (H) Solid adenocarcinoma with mucin. Numerous intracytoplasmic droplets of mucin are highlighted with this diastase-periodic acid Schiff stain.",
"           <div class=\"footnotes\">",
"           </div>",
"           <div class=\"reference\">",
"            Reproduced with permission from: Travis WD, Brambilla E, Noguchi M, et al. International Association for the Study of Lung Cancer/American Thoracic Society/European Respiratory Society International Multidisciplinary Classification of Lung Adenocarcinoma. J Thorac Oncol 2011; 6:244. Copyright &copy; 2011 Lippincott Williams &amp; Wilkins.",
"           </div>",
"          </br>",
"         </br>",
"        </br>",
"       </br>",
"      </br>",
"     </br>",
"    </br>",
"   </div>",
"  </div>",
" </div>",
"</div>"].join("\n");
