var title_f39_49_40731="Resp rxns during ASA chal";
var content_f39_49_40731=[" <div id=\"graphicsToolbar\">",
"  <div id=\"graphicsCopy\">",
"   &copy;2013 UpToDate",
"   <sup>",
"    &reg;",
"   </sup>",
"  </div>",
"  <div id=\"graphicsLinks\">",
"   <a href=\"?imageKey=ALLRG%2F71124&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=88\" onclick=\"\">",
"    <img alt=\"Print this page\" src=\"./../images/icn_print.myextg\" title=\"Print this page\"/>",
"   </a>",
"   <a class=\"icontxt textLink\" href=\"?imageKey=ALLRG%2F71124&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=88\" onclick=\"\" title=\"Print this page\">",
"    Print",
"   </a>",
"   <a class=\"etacLink\" href=\"#\">",
"    <img alt=\"Email graphic(s)\" src=\"./../images/icn_email.myextg\" title=\"Email graphic(s)\"/>",
"   </a>",
"   <a class=\"icontxt textLink etacLink\" href=\"#\" title=\"Email graphic(s)\">",
"    Email",
"   </a>",
"  </div>",
" </div>",
" <div class=\"graphic\">",
"  <div class=\"figure\">",
"   <div class=\"ttl\">",
"    Criteria for respiratory reactions during oral challenge with aspirin",
"   </div>",
"   <div class=\"cntnt\">",
"    <table cellspacing=\"0\">",
"     <tr>",
"      <td class=\"subtitle1\">",
"       ASA-induced:",
"      </td>",
"      <td class=\"subtitle1\">",
"       Events during reaction:",
"      </td>",
"     </tr>",
"     <tr>",
"      <td>",
"       Rhinitis, conjunctivitis and bronchospasm (classic reaction)",
"      </td>",
"      <td>",
"       Nasoocular reaction and &gt;15 percent decline in FEV",
"       <sub>",
"        1",
"       </sub>",
"       compared to patient's baseline",
"      </td>",
"     </tr>",
"     <tr>",
"      <td>",
"       Bronchospasm alone (lower respiratory)",
"      </td>",
"      <td>",
"       No nasoocular reaction but &gt;20 percent decline in FEV",
"       <sub>",
"        1",
"       </sub>",
"       compared to patient's baseline",
"      </td>",
"     </tr>",
"     <tr>",
"      <td>",
"       Rhinitis and conjunctivitis (upper respiratory)",
"      </td>",
"      <td>",
"       Nasoocular reactions and &lt;15 percent decline in FEV",
"       <sub>",
"        1",
"       </sub>",
"       compared to patient's baseline",
"      </td>",
"     </tr>",
"     <tr>",
"      <td>",
"       Laryngeal spasm",
"      </td>",
"      <td>",
"       Crowing sounds over trachea with an amputated inspiratory loop in the flow/volume curve",
"      </td>",
"     </tr>",
"     <tr>",
"      <td>",
"       Systemic response",
"      </td>",
"      <td>",
"       Gastrointestinal pain, flushing, urticaria, and rarely, hypotension",
"      </td>",
"     </tr>",
"     <tr>",
"      <td>",
"       Negative",
"      </td>",
"      <td>",
"       No reaction",
"      </td>",
"     </tr>",
"    </table>",
"   </div>",
"   <div class=\"lgnd\">",
"    Patients with AERD are usually premedicated with leukotriene modifying agents prior to challenge. In the absence of this premedication, a spectrum of reactions to aspirin challenge are observed. With premedication, the changes in FEV1 are dramatically reduced and/or eliminated, while nasal and ocular symptoms remain.",
"    <div class=\"footnotes\">",
"    </div>",
"    <div class=\"reference\">",
"     Reproduced with permission from: Stevenson, DD, Simon, RA, Zuraw, BL. Sensitivity to aspirin and nonsteroidal antiinflammatory drugs. In: Middleton's Allergy: Principles and Practice, 6th Ed, Adkinson, NF, Yunginger, JW, Busse, WW, et al (Eds), Mosby, St Louis, MO 2003. p.1695. Copyright &copy;2003 Elsevier.",
"    </div>",
"   </div>",
"  </div>",
" </div>",
"</div>"].join("\n");
